import React from "react";
import Home from "./Components/Homepage/Home";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Game from "./Components/Game/Game";
const App = () => {
  return (
    <>
      <Home />
      <Router>
        <Routes>
        <Route exact path="/Game" component={Game} />
        </Routes>
      </Router>
    </>
  );
};

export default App;
